import React from 'react'
import MainProject from "./pages/MainProjectPage/MainProject";
import Construction from "./pages/ConstructionPage/Construction";
import Design from "./pages/DesignPage/Design";
import SampleDesign from "./pages/SampleDesignPage/SampleDesign";


const routes = [
    {
        path: '/',
        exact: true,
        main: () => <MainProject/>
    },
    {
        path: '/design',
        exact: true,
        main: () => <Design/>
    },
    {
        path: '/construction',
        exact: true,
        main: () => <Construction/>
    },
    {
        path: '/sample-design',
        exact: true,
        main: () => <SampleDesign/>
    }
];

export default routes;
